import React from 'react';
import './dailyforecast.css';

export const DailyWeather = (props) => {
  const forACast = props.forecast;
  console.log(forACast);
  const weatherForAWeek = forACast.map((weather) => {
    return (
      <div>
        <div>
          <h5>температура: {weather.temp}</h5>
        </div>
        <div>
          <h5>чувствуется как: {weather.feels_like}</h5>
        </div>
        <div>
          <h5>мин. температура: {weather.temp_min}</h5>
        </div>
        <div>
          <h5>макс. температура: {weather.temp_max}</h5>
        </div>
        <div>
          <h5>давление: {weather.pressure}</h5>
        </div>
      </div>
    );
  });
  console.log(weatherForAWeek);
  return (
    <div className='week_weather'>
      <div className='week_weather_temp'>{weatherForAWeek}</div>
    </div>
  );
};
